function binarySearch(x, len, element){
    var low = 0;
    var high = len;

    while(low+1 < high){
        test = Math.floor((low+high)/2);
       // console.log("Test : " + test);
        if(x[test] > element){
            high = test;
        }else{
            low = test;
        }   
    }
    if(x[low] == element){
        return low;
    }else{
        return -1;
    }
    
}